/*
You have k lists of sorted integers in non-decreasing order. Find the smallest range that includes at least one number from each of the k lists.

We define the range [a, b] is smaller than range [c, d] if b - a < d - c or a < c if b - a == d - c.

 

Example 1:

Input: nums = [[4,10,15,24,26],[0,9,12,20],[5,18,22,30]]
Output: [20,24]
Explanation: 
List 1: [4, 10, 15, 24,26], 24 is in range [20,24].
List 2: [0, 9, 12, 20], 20 is in range [20,24].
List 3: [5, 18, 22, 30], 22 is in range [20,24].
Example 2:

Input: nums = [[1,2,3],[1,2,3],[1,2,3]]
Output: [1,1]
Example 3:

Input: nums = [[10,10],[11,11]]
Output: [10,11]
Example 4:

Input: nums = [[10],[11]]
Output: [10,11]
Example 5:

Input: nums = [[1],[2],[3],[4],[5],[6],[7]]
Output: [1,7]
 

Constraints:

nums.length == k
1 <= k <= 3500
1 <= nums[i].length <= 50
-105 <= nums[i][j] <= 105
nums[i] is sorted in non-decreasing order.
*/

// smarter heap
var smallestRange = function (nums) {
  let max = nums.reduce((maxVal, list) => Math.max(maxVal, list[0]), Number.MIN_SAFE_INTEGER);
  let minDistance = Number.MAX_SAFE_INTEGER;
  let minRange;

  heapify(nums);

  while (true) {
    const min = nums[0][0];
    const nextNum = nums[0][1];

    if (min === false) return minRange;

    if (max - min < minDistance) {
      minDistance = max - min;
      minRange = [min, max];
    }

    max = nextNum === undefined ? max : Math.max(max, nextNum);
    if (pop(nums) === false) return minRange;
  }
};

const heapify = (nums) => {
  const start = Math.floor(nums.length / 2) - 1;

  for (let i = start; i >= 0; i -= 1) {
    siftDown(i, nums);
  }
}

const pop = (heap) => {
  const res = heap[0].shift();
  if (!heap[0].length) return false;
  siftDown(0, heap);
  return res;
}

const siftDown = (start, heap) => {
  let current = start;
  while (true) {
    const left = current * 2 + 1;
    const right = left + 1;
    let next = current;

    if (heap[left] && heap[left][0] < heap[next][0]) next = left;
    if (heap[right] && heap[right][0] < heap[next][0]) next = right;

    if (next !== current) {
      [heap[current], heap[next]] = [heap[next], heap[current]];
      current = next;
    } else break;
  }
}

// janky heap
var smallestRange = function (nums) {
  const currentPosition = new Array(nums.length).fill(0);
  const startPosition = new Array(nums.length).fill(0);
  const range = [];
  let numsRemain = nums.length;
  let minDistance = Number.MAX_SAFE_INTEGER;
  let minRange;

  const heap = heapify(nums, currentPosition);

  let start = 0;

  while (true) {
    const curr = pop(heap, currentPosition, nums);
    range.push(curr);

    if (currentPosition[curr] - startPosition[curr] === 1) numsRemain -= 1;

    while (!numsRemain) {
      const minIdx = range[start];
      const min = nums[minIdx][startPosition[minIdx]];
      const max = nums[curr][currentPosition[curr] - 1];

      if (max - min < minDistance) {
        minDistance = max - min;
        minRange = [min, max];
      }

      startPosition[minIdx] += 1;
      if (startPosition[minIdx] === nums[minIdx].length) return minRange;
      if (startPosition[minIdx] === currentPosition[minIdx]) numsRemain += 1;
      start += 1;
    }
  }
};

const heapify = (nums, currPos) => {
  const heap = nums.map((_, i) => i);
  const start = Math.floor(heap.length / 2) - 1;

  for (let i = start; i >= 0; i -= 1) {
    siftDown(i, heap, currPos, nums);
  }

  return heap;
}

const pop = (heap, currPos, nums) => {
  const res = heap[0];
  currPos[res] += 1;
  if (currPos[res] === nums[res].length) {
    const last = heap.length - 1;
    [heap[0], heap[last]] = [heap[last], heap[0]];
    heap.pop();
  }
  siftDown(0, heap, currPos, nums);
  return res;
}

const siftDown = (start, heap, currPos, nums) => {
  let current = start;
  const len = heap.length;
  while (true) {
    const left = current * 2 + 1;
    const right = left + 1;
    let next = current;

    if (left < len && nums[heap[left]][currPos[heap[left]]] < nums[heap[next]][currPos[heap[next]]]) next = left;
    if (right < len && nums[heap[right]][currPos[heap[right]]] < nums[heap[next]][currPos[heap[next]]]) next = right;

    if (next !== current) {
      [heap[current], heap[next]] = [heap[next], heap[current]];
      current = next;
    } else break;
  }
}

